import React, { useEffect, useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import SearchPanel from "./components/SearchPanel";
import { Container, Grid } from "@mui/material";
import axios from "axios";
import Images from "./components/Images";
import UploadImage from "./components/UploadImage";
import Navbar from "./components/Navbar";

type SearchResponse = {
  url: string;
  labels: string[];
};

function App() {
  const [content, setContent] = useState("");
  const [images, setImages] = useState<String[]>([
    "https://hw3-images.s3.amazonaws.com/test.jpg",
    "https://hw3-images.s3.amazonaws.com/test.jpg",
    "https://hw3-images.s3.amazonaws.com/test.jpg",
    "https://hw3-images.s3.amazonaws.com/test.jpg",
  ]);

  const searchContent = (searchContent: string) => {
    setContent(searchContent);
  };

  useEffect(() => {
    axios
      .get(
        "https://oy9siziwkf.execute-api.us-east-1.amazonaws.com/test1/search?q=" +
          content
      )
      .then((response) => {
        console.log("Searching: " + content);
        console.log(response.data.body);
        // const urls = response.data.body.map((item: SearchResponse) => item.url);
        // console.log(urls);
        // setImages(urls);
      })
      .catch(() => {
        console.log("Error");
      });
  }, [content]);

  return (
    <>
      <Navbar />
      <Container maxWidth="md">
        <Grid
          container
          spacing={2}
          display={"flex"}
          justifyContent={"center"}
          alignItems={"center"}
        >
          <Grid
            item
            xs={10}
            display={"flex"}
            justifyContent={"center"}
            alignItems={"center"}
          >
            <SearchPanel searchContent={searchContent} />
          </Grid>
          <Grid
            item
            xs={12}
            display={"flex"}
            justifyContent={"center"}
            alignItems={"center"}
          >
            <UploadImage />
          </Grid>
          <Grid
            item
            xs={12}
            display={"flex"}
            justifyContent={"center"}
            alignItems={"center"}
          >
            <Images images={images} />
          </Grid>
        </Grid>
      </Container>
    </>
  );
}

export default App;
